import Head from "next/head";
import Layout, { siteTitle } from "../component/Layout";

const Home = () => {
  return (
    <Layout home>
      <Head>
        <title>Hello</title>
      </Head>
      <div>
        <h1>Hello world</h1>
      </div>
    </Layout>
  );
};

export default Home;
